import React, { Component } from "react";
import { } from "../index";

class Snowgraph extends Component {
  render() {
    return (
      <div
        id="snowgraph"
        className="center"
        style={{
          textAlign: "center",
          marginTop: "40px",
          display: "table-cell",
        }}
      >
      </div>
    );
  }
}

export default Snowgraph;
